import { Component } from '@angular/core';
import { HttpService } from '../services/http.service';
import { environment } from 'src/environments/environment';

const group_id = 'tokyo2020'

@Component({
  selector: 'app-home',
  templateUrl: 'home.page.html',
  styleUrls: ['home.page.scss'],
})
export class HomePage {

  base64: any = 'data:image/jpeg;base64,';
  athlete_test: any = 'data:image/png;base64,';

  postObject: any = {};

  constructor(
    private httpService: HttpService
  ) {}

  detect = () => {
    let url: string = environment.endpoint + 'detect';
    let blob = this.makeblob(this.base64);
    this.httpService.httpFaceApiBinary(url, blob).subscribe(
      res => {
        console.log(res);
      }
    );
  }

  createGroup = () => {
    // Create PersonGroup
    const url: string = environment.endpoint + 'persongroups/' + group_id;

    this.postObject["name"] = group_id;
    const body = this.postObject;

    this.httpService.httpFaceApiPut(url, body).subscribe(
      res => {
        console.log(res);
      }
    );
  }

  grouping = async () => {
    // オブジェクトの生成
    const image_list: string[] = ["1.jpeg", "2.jpeg", "3.jpeg", "4.jpeg", "5.jpeg"];
    const athlete_list: string[] = ["abe-hifumi", "hamada-shori", "harasawa-hisayoshi", "mukai-shoichiro", "yoshida-tsukasa"]
    const base_url: string = 'https://kn46itblog.com/hackathon/kdghacks_2021/images/';
    let person_dictionary: any = {}

    for(let i = 0; i < athlete_list.length; i++) {
      person_dictionary[athlete_list[i]] = image_list;
    }

    console.log(person_dictionary)
    /* const person_dictionary = {
      "Family1-Dad" : ["Family1-Dad1.jpg", "Family1-Dad2.jpg"],
      "Family1-Mom" : ["Family1-Mom1.jpg", "Family1-Mom2.jpg"],
      "Family1-Son" : ["Family1-Son1.jpg", "Family1-Son2.jpg"],
      "Family1-Daughter" : ["Family1-Daughter1.jpg", "Family1-Daughter2.jpg"],
      "Family2-Lady" : ["Family2-Lady1.jpg", "Family2-Lady2.jpg"],
      "Family2-Man" : ["Family2-Man1.jpg", "Family2-Man2.jpg"]
    }; */

    // Add person
    // Add Face
    let interval: any;
    let i: any = 0;
    interval = setInterval(() => {
      let url: string = environment.endpoint + 'persongroups/' + group_id + '/persons';
      let postObject: any = {"name": athlete_list[i]};
      const body = postObject;

      this.httpService.httpFaceApi(url, body).subscribe(
        res => {
          console.log(res)
          const value = person_dictionary[athlete_list[i]];
          let person_id: string = res['personId'];
          let k: any = i;
          
          for(let j = 0; j < image_list.length; j++) {
            let url: string = environment.endpoint + 'persongroups/' + group_id + '/persons/' + person_id + '/persistedFaces';
            let image_url: string = base_url + athlete_list[k] + '/' + value[j];
            let postObject: any = {"url": image_url};
            const body = postObject;
    
            this.httpService.httpFaceApi(url, body).subscribe(
              res => console.log(athlete_list[k], j, res),
              error => console.log(error, j, res)
            );
          };

          i++;
          if(i >= athlete_list.length) clearInterval(interval);
        }
      );
    }, 2000);
  }


  training = () => {
    // Start to train the person group.
    // Train
    const url: string = environment.endpoint + 'persongroups/' + group_id + '/train';

    const body = {};
    let interval: any;

    this.httpService.httpFaceApi(url, body).subscribe(
      res => {
        console.log(res);
        interval = setInterval(() => {
          const url: string = environment.endpoint + 'persongroups/' + group_id + '/training';

          this.httpService.httpFaceApiGet(url).subscribe(
            res => {
              console.log(res);
              if(res["status"] === "succeeded") clearInterval(interval);
            }
          );
        }, 10000)
      }
    );
  }
  checkTraining = () => {
    let interval: any;
    interval = setInterval(() => {
      const url: string = environment.endpoint + 'persongroups/' + group_id + '/training';

      this.httpService.httpFaceApiGet(url).subscribe(
        res => {
          console.log(res);
          if(res["status"] === "succeeded") clearInterval(interval);
        }
      );
    }, 10000)
  }

  identify = () => {
    // Detect
    let url: string = environment.endpoint + 'detect';
    let blob = this.makeblob(this.athlete_test);
    this.httpService.httpFaceApiBinary(url, blob).subscribe(
      res => {
        // Identify
        let url: string = environment.endpoint + 'identify';
        const body = {
          "faceIds": [res[0]["faceId"]],
          "personGroupId": group_id,
          "maxNumOfCandidatesReturned": 1,
          "confidenceThreshold": 0.5
        }
        this.httpService.httpFaceApi(url, body).subscribe(
          res => {
            // Get User Information
            // console.log(res);
            let personId: string = res[0]['candidates'][0]['personId']
            const url: string = environment.endpoint + 'persongroups/' + group_id + '/persons/' + personId;

            this.httpService.httpFaceApiGet(url).subscribe(
              res => {
                console.log(res);
                console.log(res["name"])
              }
            );
          }
        );
      }
    );
  }

  private makeblob(dataURL) {
    const BASE64_MARKER = ';base64,';
    const parts = dataURL.split(BASE64_MARKER);
    const contentType = parts[0].split(':')[1];
    const raw = window.atob(parts[1]);
    const rawLength = raw.length;
    const uInt8Array = new Uint8Array(rawLength);

    for (let i = 0; i < rawLength; ++i) {
      uInt8Array[i] = raw.charCodeAt(i);
    }

    return new Blob([uInt8Array], { type: contentType });
  }

  delete = () => {
    // Delete PersonGroup
    const url: string = environment.endpoint + 'persongroups/' + group_id;

    this.httpService.httpFaceApiDelete(url).subscribe(
      res => {
        console.log(res);
      }
    );
  }

}
